import InputGroup from 'react-bootstrap/InputGroup';

const content=(props)=>{
    return(
        <div>
            <InputGroup className="mb-3">
                <FormControl
                    placeholder="Username"
                    aria-label="Username"
                    aria-describedby="basic-addon1"
                />
            </InputGroup>
        </div>
    )
}

export default content
